import './Patient.css';
import Card from "./Cards/Card"
import CoWithYou from "./CoWithYou Logo.png"
const Patient=()=>{
    return(
        <>
        <div className="container" id="container">
        <div id="header">
            
        </div>
        <div>
        <Card/>
        </div>
        </div>
        </>
    )
}
export default Patient
